import React from 'react';
import { ListGroup, Container } from 'react-bootstrap';
import ButtonContainer from '../components/StyledButtonContainer';
import StyledSectionButton from '../components/StyledSectionButton';
import ButtonList from '../components/StyledButtonList';
import MyContainer from '../components/StyledContainer';

function Social() {
    return (
        <MyContainer>
        <ButtonList>
            <StyledSectionButton href="https://github.com/Andrew-Cutlip">
                Github
            </StyledSectionButton>
            <StyledSectionButton href="https://www.linkedin.com/in/andrew-cutlip-3322b917a/">
                Linkedin
            </StyledSectionButton>
            <StyledSectionButton href="https://twitter.com/CutlipDev">
                Twitter
            </StyledSectionButton>
            <ListGroup.Item className="sectionButton" action href="https://github.com/Andrew-Cutlip">Github</ListGroup.Item>
            <ListGroup.Item className="sectionButton" action href="https://www.linkedin.com/in/andrew-cutlip-3322b917a/">Linkedin</ListGroup.Item>
            <ListGroup.Item className="sectionButton" action href="https://twitter.com/CutlipDev">Twitter</ListGroup.Item>
        </ButtonList>
        </MyContainer>
    )
}

export default Social;
